<script>
const regioes = {"Norte": ["AC", "AP", "AM", "PA", "RO", "RR", "TO"], "Nordeste": ["AL", "BA", "CE", "MA", "PB", "PE", "PI", "RN", "SE"], "Centro-Oeste": ["DF", "GO", "MT", "MS"], "Sudeste": ["ES", "MG", "RJ", "SP"], "Sul": ["PR", "RS", "SC"]};

function toggleLayers(show) {
    document.querySelectorAll('.leaflet-control-layers-overlays input').forEach(cb => {
        if (cb.checked !== show) cb.click();
    });
}

function toggleRegiao(regiao, show) {
    const estados = regioes[regiao];
    document.querySelectorAll('.leaflet-control-layers-overlays label').forEach(label => {
        estados.forEach(uf => {
            if (label.textContent.trim() === uf) {
                const cb = label.querySelector("input");
                if (cb && cb.checked !== show) cb.click();
            }
        });
    });
}

function criarBotoesRegioes() {
    const container = document.createElement("div");
    container.style.position = "fixed";
    container.style.top = "80px";
    container.style.left = "10px";
    container.style.zIndex = "9999";
    container.style.background = "white";
    container.style.border = "1px solid #999";
    container.style.padding = "10px";
    container.style.borderRadius = "6px";
    container.style.boxShadow = "2px 2px 4px rgba(0,0,0,0.3)";
    container.innerHTML = `
        <b>Regi√µes:</b><br><br>
        ${Object.keys(regioes).map(reg => `
            <label><input type="checkbox" class="regiao-checkbox" onchange="toggleRegiao('${reg}', this.checked)"> ${reg}</label><br>
        `).join("")}
        <br>
        <button onclick="toggleLayers(true)">Mostrar todos</button>
        <button onclick="
            toggleLayers(false);
            document.querySelectorAll('.regiao-checkbox').forEach(cb => cb.checked = false);
        ">Ocultar todos</button>
    `;
    document.body.appendChild(container);
}

document.addEventListener("DOMContentLoaded", criarBotoesRegioes);
</script>
